window.bookSummaryJSON = "<p>I chose the man I want to be with...the universe disagrees.</p> <p>Access to the Fae Realm has been lost for centuries, so when my brother mates with the mythical phoenix and becomes part of the Guardian Quint, things get interesting. Their destiny is to reestablish the portal gate and unite the realms. I tag along for the ride.</p> <p>I'm used to living in the shadow of my family.</p> <p>My father and mother are the late Fae Prime and his Prima, my brother the new king. I'm nothing as grand as them. I'm the daughter, the sister, the liaison between Kotah and the life of rule he never wanted. I know who I am though, and have my own strengths. I also have a certain someone I have my heart set on.</p> <p>Until him...</p> <p>With two realms uniting and bursting with possibility, my world is shattered with a <i>Dark Curse.</i></p> <p>*This is the sixth audiobook in the second harem of the Guardians of the Fae Realms, steamy reverse harem paranormal romance series. Expect sexy polyamorous situations (mmmfm), rollicking action, ongoing storylines, and shifter lovers who find what they need from not only their queen, but each other as well. Med-burn, med angst, vivid sexual content, and language.*</p>"; 
